func Generate(db1 driver.Database) {
	j := 0
	for i := 0; i < len(labels); i++ {
		if j >= len(brands) {
			j = 0
		}
		c := &Catalog{
			Name:   uuid.NewUUIDAsString(),
			Brand:  brands[j],
			Labels: labels[i],
			Price:  rand.Float64() + float64(rand.Int31()),
		}

		b, err := json.Marshal(c)
		if err != nil {
			panic(err)
		}

		_, err = db1.Insert(context.Background(), "catalog", []driver.Document{b})
		if err != nil {
			fmt.Println("error ", err)
			fmt.Println(string(b))
			panic(err)
		}
		j++
	}
}

func main() {
	h, p := "localhost", 8081
	driver.DefaultProtocol = driver.HTTP
	c, err := driver.NewDriver(context.Background(), &clientConfig.Driver{
		URL: fmt.Sprintf("http://%s:%d", h, p),
	})
	if err != nil {
		panic(err)
	}
	defer func() { _ = c.Close() }()
	db1 := c.UseDatabase("db1")
	Generate(db1)
}
